import React, { Component } from 'react';

class Login extends Component {
  render() {
    return (
      <section>
        <form>
          <label htmlFor="email">
            Email
            <input type="email" name="email" testid="email-input" />
          </label>
          <label htmlFor="password">
            Senha
            <input type="password" name="password" testid="password-input" />
          </label>
          <button>Entrar</button>
        </form>
      </section>
    );
  }
}

export default Login;
